import React from 'react';
import styled from "styled-components";

const Menu = styled.div`
    position: fixed;
    display: flex;
    bottom: 0;
    width: 560px;
    background-color: #efefef;
    height: 120px;
    left: 50px;
`;

class Menubar extends React.Component{
    render() {
        return <Menu>Menu</Menu>
    }
}

export default Menubar;
